import React from 'react';
import './Profile.scss';

const Profile = () => {
  return (
    <div className="prof">
      <div className="container">
        <div className="prof__header">
          <h1 className="prof__header-nick">__procherk__</h1>
          <button className="prof__header-edit"></button>
          <div className="prof__header-settings"></div>
        </div>
        <ul>
          <li>
            <span>38</span> posts
          </li>
          <li>
            <a href="">
              <span></span>
            </a>
          </li>
          <li>
            <a href=""></a>
          </li>
        </ul>
      </div>
    </div>
  );
};
export default Profile;
